import React from 'react';
import logo from './logo.svg';
import './App.css';
import Signup from './Signup';
import Login from './Login';
import Search from './Search';
import Recipe from './Recipe';
import Pantry from './Pantry';
import Favorite from './Favorite';
import Restriction from './Restriction';
import Menu from './Menu';
import { Component } from 'react';
import { BrowserRouter, Route, Switch } from 'react-router-dom';
import { tsConstructorType } from '@babel/types';
import Rootstore from './Rootstore';


function App() {
  const _store =  new Rootstore;



  return (
    <div className="App">
      {/* <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header> */}
      <Menu/>
      <Switch>
      <Route path='/signup' render={(props)=><Signup {...props} store = {_store.Instance()}/>} />      
      <Route path='/login' render={(props)=><Login {...props} store = {_store.Instance}/>} />
      <Route path='/search' render={(props)=><Search {...props} store = {_store.Instance}/>} />
      <Route path='/recipe' render={(props)=><Recipe {...props} store = {_store.Instance}/>} />
      <Route path='/pantry' render={(props)=><Pantry {...props} store = {_store.Instance}/>} />
      <Route path='/favorite' render={(props)=><Favorite {...props} store = {_store.Instance}/>}/>
      <Route path='/restrictions' render={(props)=><Restriction {...props} store = {_store.Instance}/>} />
      </Switch>






    </div>
  );
}

export default App;
